package com.java.practice;

public class D9_Type_Casting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		
		int a=1000;
		byte b=(byte) a;
		System.out.println(b);
		
		byte b1=50;
		double d=b1;
		System.out.println(d);
		
		double d1=10.2;
		long l=(long) d1;
		System.out.println(l);
	}

}
